import React from 'react'
import {Link, useParams} from "react-router-dom"



function NotEnoughCards({studyDeck}){
  const deckId=useParams();
  console.log(deckId)
  let result
  if(studyDeck!==undefined){
    result=(
      <>
        <div className="row">
          <h3>Not Enough Cards</h3>
        </div>
        <p className="row">You need atleast 3 cards. You have {studyDeck.cards.length} cards.</p>
        <div className="row">
          <button className={"col-2 btn btn-primary"}><Link to={`/decks/${deckId}/cards/new	`}>Add Card</Link></button>
        </div>
      </>
      )
  }
  return result;
}


export default NotEnoughCards;
